import React from 'react';

const Card = () => {
    return (
        <div className="bg-light-green br3 pa3 ma2 grow">
            <img alt="robots" src="https://robohash.org/test?200x200" />
            <div>
                <h2>Atakan Temel</h2>
                <p>atakan.baba@temel.com</p>
            </div>
        </div>
    );
}

export default Card;
